import React from 'react'
import Header from './Header'
import PokeCard from './PokeCard'
import { nanoid } from 'nanoid'
import './style.css';

function App() {

  const [id, setId] = React.useState({
    startId: 1,
    endId: 20
  })

    

  const pokemonCards = (id) => {
  
    for (let i = id.startId; i < id.endId; i++) {
      return (
        <div key={nanoid()}  className='pokemon'>
          <PokeCard props={i} />
        </div>
      )
    }
  
  }

    return (
    <div className="App">
      <Header />
      
      {pokemonCards}
    </div>
  );
    


}

export default App;
